    modifier isCorrectMaturity(uint256 epoch) {
        require(epoch == NEXT_DAY ||
                epoch == ONE_WEEK ||
                epoch == TWO_WEEKS ||
                epoch == THREE_WEEKS ||
                epoch == ONE_MONTH ||
                epoch == TWO_MONTHS ||
                epoch == THREE_MONTHS ||
                epoch == FOUR_MONTHS ||
                epoch == FIVE_MONTHS ||
                epoch == SIX_MONTHS ||
                epoch == SEVEN_MONTHS ||
                epoch == EIGHT_MONTHS ||
                epoch == NINE_MONTHS ||
                epoch == TEN_MONTHS ||
                epoch == ELEVEN_MONTHS ||
                epoch == ONE_YEAR ||
                epoch == TWO_YEARS ||
                epoch == THREE_YEARS ||
                epoch == FOUR_YEARS ||
                epoch == FIVE_YEARS ||
                epoch == SIX_YEARS ||
                epoch == SEVEN_YEARS ||
                epoch == TEN_YEARS,
                "incorrect maturity date");
        _;
    }

    modifier correctLotSize(uint256 lots) {
        require(lots >= 1 && lots <= 100,"lots out of bounds");
        _;
    }

    modifier notWithdrawing() {
        require(inWithdrawal == false,"withdrawal in progress");
        _;
    }

